{% extends '@PrestaShop/base.html.twig' %}

{% block stylesheets %}
  {{ parent() }}
  <link rel=\"stylesheet\" href=\"{{ asset('themes/new-theme/public/theme' ~ rtl_suffix ~ '.css') }}\" />
{% endblock %}

{% block title %}
